response.about:
Больше всего на свете страдаю от:
- нехватки времени;
- нехватки собственной жизненной энергии;
- нехватки общения именно тогда, когда обязательно надо что-то обсудить.
Радует:
- книги;
- истории пути;
- искусство, особенно, когда я его понимаю; 
- путешествия;
- интересные люди;
- красивые люди;
- когда чувствую, что по своей воле что-то меняю.
